import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Links from './Links';
import reportWebVitals from './reportWebVitals';



// add css styles for Twitter Bootstrap
const bootstrapStyleLink = document.createElement("link");
bootstrapStyleLink .rel = "stylesheet";
bootstrapStyleLink .href = "https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.6.1/css/bootstrap.min.css";
document.head.appendChild(bootstrapStyleLink );

// add css styles for semantic-ui-react
const semanticStyleLink = document.createElement("link");
semanticStyleLink.rel = "stylesheet";
semanticStyleLink.href = "https://cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.4.1/components/dropdown.min.css";
document.head.appendChild(semanticStyleLink);

ReactDOM.render(
  <React.StrictMode>
    <Links />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
